INSERT INTO `websiteoffre` (`id`, `type_offre`, `etat`, `titre`, `date_publication`, `societe`, `mission`, `experience`, `type_contrat`, `remuneration`, `profil`, `nom_recruteur`, `email_recruteur`, `tel_recruteur`, `modalite`, `domaine`, `ville`) VALUES
(9, 1, 1, 'Hôte, hôtesse d''accueil', '2016-09-08 00:00:00', 'Exelle', '<p>Nous recherchons un(e) hôte(sse) d''accueil/ standardiste pour un site très prestigieuse à Paris dans le 75008 pour les missions suivantes:</p>\r\n<ul>\r\n    <li>Accueil physique et téléphonique</li>\r\n    <li>Gestion du courrier/coursiers</li>\r\n    <li>Prise de messages</li>\r\n    <li>Réservation des salles</li>\r\n    <li>Mise à jour des fichiers</li>\r\n    \r\n</ul>', 'moins d''1 ans', 'CDI', 1400, '<p>Nous recherchons un(e) hôte(sse) d''accueil/ standardiste pour un site très prestigieuse à Paris dans le 75008 Anglais courant exigé.\r\n\r\nPar email: recrutement@exelle.net\r\nPar téléphone: 01 45 89 41 67\r\nModalités : CV + lettre de motivation par mail, réf FNAIM\r\nContact : Anande CROSS ', 'Anande CROSS ', 'recrutement@exelle.net', '01 45 89 41 67', ' CV + lettre de motivation par mail, réf FNAIM', 5, 1597),
(12, 2, 2, 'Développeur Informatique ', '2016-09-02 00:00:00', 'Atos', 'Gestion de projet, développement d''applications intranet et de progiciels.', '2 ans', 'CDD', 1900, 'Ingénieur informatique, Capacité d''adaptation, prise d''initiative\r\n', 'David Pascal', 'd.pascal@atos.yt', '', 'Veuillez envoyer par email votre CV et votre lettre de motivation ', 4, 2);
INSERT INTO `websitepole` (`id`, `nom`, `description`) VALUES
(1, ' Pôle trésorerie et partenariat', '<p>Quod in homine multo est evidentius, primum ex ea caritate quae est inter natos et parentes, quae dirimi nisi detestabili.</p>'),
(2, 'Pôle administration', '<p>Quod in homine multo est evidentius, primum ex ea caritate quae est inter natos et parentes, quae dirimi nisi detestabili.illa res utilitatis esset habitura. Quod quidem quale sit, etiam in bestiis quibusdam animadverti potest.</p>'),
(3, ' Pôle éducatif', '<p>Quod in homine multo est evidentius, primum ex ea caritate quae est inter natos et parentes, quae dirimi nisi detestabili.</p>'),
(4, 'Pôle culturel', '<p>Quod in homine multo est evidentius, primum ex ea caritate quae est inter natos et parentes, quadirimi nisi detestabili.</p>');
INSERT INTO `websiterealisation` (`id`, `titre`, `description`) VALUES
